import React from 'react';
import '../../styles/experiencecard.scss';

interface ExperienceCardProps {
  title: string;
  company: string;
  location: string;
  link: string;
  duration: string;
  description: string;
  skills: string[];
}

const ExperienceCard = ({ title, company, location, website, description, skills, dates }) => {
    return (
      <div className="experience-card">
        <div className="card-header">
          <h2 className="card-title">{title}</h2>
          <p className="card-company">{company}</p>
          <p className="card-location">{location}</p>
          <a href={website} className="card-website">{website}</a>
        </div>
        <div className="card-body">
          <p className="card-description">{description}</p>
          <ul className="card-skills">
            {skills.map((skill) => (
              <li key={skill}>{skill}</li>
            ))}
          </ul>
        </div>
        <div className="card-footer">
          <p className="card-dates">{dates}</p>
        </div>
      </div>
    );
  };
  
  export default ExperienceCard;
